import EachNews from './EachNews/EachNews'
import './News.css'



let newsElements = props.newsElements.map( n => <EachNews name={n.name} article={n.article}/>)

const News = (props) =>{
	return(
		<div className='main-screen__news'>
			{newsElements}
		</div>
	)
}
export default News;
